import {faCog, faMap, faUser, faVideo} from '@fortawesome/free-solid-svg-icons'
import React from 'react'
import {Link} from 'react-router'
import MenuItem from './MenuItem.js'

const style= {
    background: '#ed217c',
    paddingLeft: '5%'
}

function MainMenu() {
  return (
            <div className = 'MainMenu' display='block' style={style}>
                <MenuItem name = 'Identifícate' icon = {faUser}><Link to ={"/Identificate"}></Link></MenuItem>
                <MenuItem name='Mapa' icon={faMap}><Link to ={"/Mapa"}></Link></MenuItem>
                <MenuItem name='Publicidad' icon={faVideo}><Link to ={"/Publicidad"}></Link></MenuItem>
                <MenuItem name = 'Configuración' icon = {faCog}><Link to ={"/Configuracion"}></Link></MenuItem>
            </div>
        );
}

export default MainMenu;
